const ItemTopLocations = () => {
  return (
    <div
      style={{
        width: 200,
        height: 150,
        backgroundColor: '#eeeeee',
        marginLeft: 2,
        marginRight: 2,
      }}
    >
      <strong>Loction name</strong>
      <img src={image} style={{width: 200, height: 150}}></img>
    </div>
  );
};
export default ItemTopLocations;
